import React from "react";
import MyPastDialogs from "./MyPastDialogs/MyPastDialogs";
import "../Dialogs.css";

let dialogsData = [
    {id: 1, name: 'Гослинг'},
    {id: 2, name: 'Вася'},
    {id: 3, name: 'Путин'},
    {id: 4, name: 'Трамп'},
    {id: 5, name: 'Обама'},
    {id: 6, name: 'Мэнсон'},
    {id: 7, name: 'Антошка'}
]

let dialogElements = dialogsData
    .map( dialog => <MyPastDialogs name={dialog.name} id={dialog.id} />);

const Slider = (props) => {
    return (
        <div className="slider">
            {dialogElements}
        </div>
    );
}

export default Slider;
